class Addmessage extends Component{
    constructor(props){
        super(props);
        this.handleAddmessage=this.handleAddmessage.bind(this);
    }
    render(){
        return(
            <Fragment>
                <div>
                    新增信息
                </div>
                <div>姓名：<input/></div>
                <div>性别：<input/></div>
                <div>年龄：<input/></div>
                <div>爱好：<input/></div>
                <button onClick={this.handleAddmessage}>确认添加</button>
            </Fragment>

        )
    }
    handleAddmessage(){
        console.log(123)
    }
}

export default Addmessage;
